import React, { Component, useRef } from "react";
import 'twitch-stream-embed';


class TwitchView extends Component {
	constructor(props) {
    super(props);

		this.setState({
			muted: props.muted
		})

  }

	render() {
  	return (
  	  <div>
				<twitch-stream channel="ampm_m" muted={this.props.muted}></twitch-stream>;
  	  </div>
  	);
	}
}

export default TwitchView;
